  true,\n\t\"url\": null,\n\t\"notes\": \"CIO defines IT processes and policies. The
  CIO defines the development processes, milestones, review gates, and the overall
  policies for all capital planning, enterprise architecture, and project management
  and reporting for IT resources. At a minimum, these processes shall ensure that
  the CIO certifies that IT resources are adequately implementing incremental development
  (as defined in the below definitions). The CIO should ensure that such processes
  and policies address each category of IT resources appropriatelyu2014for example,
  it may not be appropriate to apply the same process or policy to highly customized
  mission-specific applications and back office enterprise IT systems depending on
  the agency environment.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
